(95210, 24578, 8356, 1, 'NMNH_album_demo.wav', '2015年這張專輯最甜蜜！！！\nNo Money No Honey 籌備三年全新大碟< What The Frank? > 強力席捲獨立電子樂團市場，最跳最親切最開心的電子搖滾今年就聽這張！\n回想一下，\n當你遇到壞情人的欺騙，由悲傷轉為憤怒;\n當你把所有男人當作點心，自由享用時的美好;\n當你想逃避，就是不想接電話;\n當你極度渴望愛與被愛的寂寞;\n當你遇到自作多情的人時的無奈;\n這時候就聆聽<What the Frank?>這張專輯吧！\n儘管在內心用力怒吼來發發牢騷，也能感受到最甜蜜的暴力衝擊。\nNo Money No Honey由兩姊妹，姊姊Shiny和妹妹Kate組成，喜歡有活力的重節奏音樂，玩著令人納悶又有點無厘頭的電子搖滾，歌曲輕鬆怪異又有趣，創作出獨特多元的樂風。\n整張專輯運用了不同的元素和編曲形式來表現，雙主唱甜美女聲的碎碎唸，類比合成器幽默的旋律以及渾厚的聲響，融合各式曲風如funk, rock的吉他編曲，大鼓和貝斯緊密的對點，塑造截然不同的舞曲節奏，用Rock''n Roll的方式來呈現NMNH獨特的音樂性。最後，就跟著強烈的音樂一起搖擺，來場超級甜心派對吧！', '2015-02-03 00:00:00', 2000, 19, 2, 3, '', '', 271, '', '', '', '', 'No Money No Honey', '', 1, 1, 0, '2015-03-09 00:54:24', '2015-03-12 14:18:37', '0000-00-00 00:00:00'),
(95211, 132286, 7048, 2, '碎片(demo)', '', '2015-03-07 00:00:00', 2000, 19, 1, 7, '我撿到了你掉下來的碎片\n然後把它黏在我的身上\n我想要變得變得像你一樣\n過去和未來我已不去想\n反正他們通通都一樣\n我只想變得變得像你一樣\n\n我穿戴著你的衣裳\n我模仿著你的 \n我揣摩著你的想法\n我參考著你的\n\nHey they say I''m losing my face\nNo I think you will never understand \ngive me one more chance to make it \ngive me one more chance to make it \ngive me one more chance to make it \nI Want your perfect life', '', 333, '', '', '', '', '微酸的偷窺狂', '', 1, 1, 0, '2015-03-09 12:57:02', '2015-03-12 14:18:37', '0000-00-00 00:00:00'),
