(95227, 340893, 0, 1, 'Galicia Fantacy- 試聽版', '2011 年，我拜訪了位於西班牙西北部的省份 Galicia，它與鄰國葡萄牙相接，走在A Guarda 濱海城鎮那些古意盎然的街道，它有著許多與北台灣海岸都市街景的相似之處，像是建築風格、街道景觀，曾經，我一度以為自己身在淡水紅毛城，三百多年前西班牙人曾於北台灣歷時16年的殖民統治，留下歷史文化足跡，在時空上是連結在一塊的，不曾抹滅。\n    三百多年的歷史時空，台灣與西班牙曾是被大海漂流奇妙機緣銜接起來，台灣過去在殖民階段，多是處於悲情情感，然而面對著當年歷史文化遺跡，深為過客的我，增添許多想像空間。我頓時忘了街道巷弄的路徑，身處何處，那迷失不見的青春 ，仰望著天，映著曾經熟悉的天色，那雲裡的容顏依舊，幻化成一支浪舞的蝶。登上高處，遠望歲月流竄的巷弄，彷彿看見佇足少年的身影，浮現在城市的窗前。\n', '2015-05-07 00:00:00', 2000, 19, 2, 16, '', '', 391, '', '欽聖', '', '欽聖', '欽聖', '', 0, 0, 1, '2015-03-09 14:39:13', '2015-03-09 15:05:20', '2015-03-09 15:05:20'),
(95228, 184434, 0, 1, 'She''s gonna leave my heart tonight(Demo)', '', '2015-03-09 00:00:00', 2000, 19, 2, 10, '妳仍是我心中唯一 也造就了許多無奈\n\n反覆撕裂我的情感 自我在哪裡\n\n妳我氛圍也然黯淡 我們能夠走到哪裡\n\n曾經妳已然離去 我還不願清醒\n\n*You love him I can see\nI know you still with him\n\nYou love him I can see\nI know you still with him\n\n太多太傷的感受 我也嘲笑那脆弱的自己\n\n我遙望著妳的喜悅 沒有期待的等待還在等待妳\n', '', 309, '', '精神解放樂隊', '洛克人', '', '精神解放樂隊', '', 0, 1, 0, '2015-03-09 17:18:22', '2015-03-12 14:18:37', '0000-00-00 00:00:00'),
